import React from "react";
import './Paged.css';



export default function Paged({ pokePerPage, pokemons, paged }) {
  let pagedNumber = [];
  for (let i = 1; i <= Math.ceil(pokemons / pokePerPage); i++) {
    pagedNumber.push(i)
  }

  return (
    <div className="paged">
      <div className="lista">
        {pagedNumber?.map(number => {
          return (
            <p className="anchor" key={number} onClick={() => paged(pagedNumber)}>{number}</p>
          )
        })}
      </div>
    </div>

  )
}
